    border-bottom: 1px solid; 
    color: var(--hover-text-color);
  }


  .hamburger {
    display: none;
  }

  .bar {
    display: block;
    width: 25px;
    height: 3px;
    margin: 5px auto;
    transition: all 0.3s ease-in-out;
    background-color: #101010;
  }
}

@media (max-width: 768px) {
  section {
    justify-content: center;
    justify-content: space-between;

  .nav-items {
    position: absolute;
    top: 5.5rem;
    right: 40%;
    display: grid;
    border-radius: 10px;
    transition: 0.3s;

		a {
      margin: 1px auto;
      font-weight: 300;
    }

    a:last-child {
      margin: 1rem auto;
    	}
    }

    .nav-items.active {
      left: 100%;
    }

    nav > a {
      margin: 1rem 0;
    }

    .hamburger {
      display: block;
      cursor: pointer;
      position: fixed;
      top: 2rem;
      right: 0.4rem;
    }

    .hamburger.active span:nth-child(1) {
      transform: translateY(8px) rotate(45deg);
    }

    hamburger.active span:nth-child(2) {
      display: none !important;
      position: absolute;
      left: 100%;
    } 

    .hamburger.active span:nth-child(3) {
      transform: translateY(-8px) rotate(-45deg);
    }
	}
}

