      margin: 5px 0;
      margin: 5px 10px;
      .button {
        &.primary {
          display: flex;
          position: absolute;
          right: 70px;
          top: 1;
          width:90px;
        }
      }
      .close {
        display: flex;
        margin: 0 32px;
        position: absolute;
        right: 0;
        top: 1;
      }
      .button {
        display: none;
      }
    }
  }
}

/* mobile screen */
@media (max-width: 400px) {
  section {
    nav {
      gap: 32px;
      .nav-links {
        display: none;
      }

      button {
        display: none;
      }
      svg {
        margin-top: 10px;
      }
    }

    div {
      .close {
        display: none;
        margin: 0;
      }
      .button {
        margin-top: 10px;
      }
      .toggle-button {
        display: flex;
        margin-top: 10px;
      }
    }
  }
}

